import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Button, Dialog, IconButton } from "@material-ui/core";
import AddCircleOutlineIcon from "@material-ui/icons/AddCircleOutline";
import InputCommon from "../../../Common/InputCommon";
import CloseIcon from "@material-ui/icons/Close";
import { useState } from "react";
// import axios from "axios";
import { useHistory } from "react-router";

const useStyles = makeStyles((theme) => ({
  buttonmaterial: {
    borderRadius: "45px",
    backgroundColor: "#cf9f25",
    boxShadow: "none",
    color: "white",
    border: "none",
    width: "400px",
    height: "45px",
    outline: "none",
    margin: "20px",
    textTransform: "uppercase",
    "&:hover": {
      backgroundColor: "#FFC93C",
    },
  },
}));

export default function NewProject({ primary }) {
  const classes = useStyles();
  const history = useHistory();
  const [open, setOpen] = React.useState(false);
  const [interlocutor, setInterlocutor] = useState({
    firstname: "",
    lastname: "",
    email: "",
    password: "",
  });
  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  const handleChangeRh = (e) => {
    setInterlocutor({ ...interlocutor, [e.target.name]: e.target.value });
  };

//   const handleClickRh = async () => {
//     await axios
//       .post("http://localhost:3031/admin", interlocutor)
//       .then((response) => {
//         setInterlocutor(response.data);
//         setOpen(false);
//         window.location.reload();
//       });
//   };

  return (
    <div>
      {/* bouton pour créer un nouveau rh/interloc */}
      <Button
        className={classes.buttonmaterial}
        variant="contained"
        onClick={handleClickOpen}
        startIcon={<AddCircleOutlineIcon />}
      >
        Add new project realized!
      </Button>
      {/* pop up pour mettre les infos du nouveau interloc */}
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <IconButton onClick={handleClose}>
          <CloseIcon />
        </IconButton>
        <InputCommon
          indication="Prénom"
          value={interlocutor.firstname}
          name="firstname"
          onChange={handleChangeRh}
        />
        <InputCommon
          indication="Nom"
          value={interlocutor.lastname}
          name="lastname"
          onChange={handleChangeRh}
        />
        <InputCommon
          indication="Email"
          value={interlocutor.email}
          type="email"
          name="email"
          onChange={handleChangeRh}
        />
        <InputCommon
          indication="Password"
          value={interlocutor.password}
          type="password"
          name="password"
          onChange={handleChangeRh}
        />
        <Button className={classes.buttonmaterial} onClick={handleClickRh}>
          Valider
        </Button>
        <Button className={classes.buttonmaterial} onClick={handleClose}>
          Annuler
        </Button>
      </Dialog>
    </div>
  );
}
